import React from "react";
import Explore from "./explore";
import '../CSS/bookmark.css'
const Bookmark = (props) => {
    return (
        <>
        <h2>Bookmarked Cards</h2>
            <Explore product = {props.item} />
        </>
    );
}
export default Bookmark;
